import styled from "styled-components";

export const Form = styled.form`
	display: flex;
	flex-direction: column;
	width: 50%;
	margin: 3% auto;
	@media (max-width: 700px) {
		margin: 2% 10%;
		width: 300px;
	}
	@media (min-width: 1600px) {
		width: 80%;
		margin: 8% auto;
	}
`
